Body: {
  "jsonrpc": "2.0",
  "result": {
    "tools": [
      {
        "name": "save_journal",
        "description": "新しい仕訳を保存します",
        "inputSchema": {
          "type": "object",
          "properties": {
            "header": {
              "type": "object",
              "properties": {
                "journalDate": {
                  "type": "string",
                  "description": "計上日 (YYYY-MM-DD形式)"
                },
                "description": {
                  "type": "string",
                  "description": "摘要"
                }
              },
              "required": [
                "journalDate"
              ]
            },
            "details": {
              "type": "array",
              "items": {
                "type": "object",
                "properties": {
                  "debitCredit": {
                    "type": "string",
                    "enum": [
                      "debit",
                      "credit"
                    ]
                  },
                  "accountCode": {
                    "type": "string"
                  },
                  "baseAmount": {
                    "type": "number"
                  },
                  "taxAmount": {
                    "type": "number"
                  },
                  "totalAmount": {
                    "type": "number"
                  }
                },
                "required": [
                  "debitCredit",
                  "accountCode",
                  "baseAmount",
                  "taxAmount",
                  "totalAmount"
                ]
              },
              "minItems": 2
            }
          },
          "required": [
            "header",
            "details"
          ]
        }
      },
      {
        "name": "search_journals",
        "description": "仕訳を検索します",
        "inputSchema": {
          "type": "object",
          "properties": {
            "searchTerm": {
              "type": "string"
            },
            "fromDate": {
              "type": "string"
            },
            "toDate": {
              "type": "string"
            },
            "page": {
              "type": "number",
              "default": 1
            },
            "limit": {
              "type": "number",
              "default": 20
            }
          }
        }
      }
    ]
  },
  "id": 2
}

Initialize result: {
  protocolVersion: '0.1.0',
  capabilities: { tools: {}, sse: { endpoint: '/sse' } },
  serverInfo: { name: 'biz-clone-mcp-server', version: '1.0.0' }
}
